import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { FaStar } from 'react-icons/fa';

const mentors = [
  {
    id: '1',
    name: 'Rishabh Jain',
    title: 'Senior Software Engineer',
    skills: ['React', 'Node.js', 'Python'],
    rating: 5,
    reviews: 127,
    available: true,
    profileImage: '/mentors/rishabh.jpg'
  },
  {
    id: '2',
    name: 'Priya Sharma',
    title: 'Machine Learning Engineer',
    skills: ['Python', 'TensorFlow', 'Data Science'],
    rating: 4.9,
    reviews: 98,
    available: true,
    profileImage: '/mentors/priya.jpg'
  },
  {
    id: '3',
    name: 'Arjun Patel',
    title: 'Frontend Developer',
    skills: ['React', 'JavaScript', 'UI/UX'],
    rating: 4.8,
    reviews: 156,
    available: true,
    profileImage: '/mentors/arjun.jpg'
  },
  {
    id: '4',
    name: 'Neha Gupta',
    title: 'Mobile App Developer',
    skills: ['React Native', 'iOS', 'Android'],
    rating: 4.9,
    reviews: 112,
    available: true,
    profileImage: '/mentors/neha.jpg'
  },
  {
    id: '5',
    name: 'Rahul Verma',
    title: 'DevOps Engineer',
    skills: ['Docker', 'Kubernetes', 'AWS'],
    rating: 4.7,
    reviews: 89,
    available: true,
    profileImage: '/mentors/rahul.jpg'
  },
  // Add more mentors...
];

const FindMentor = () => {
  const [searchQuery, setSearchQuery] = useState('');
  const [selectedSkills, setSelectedSkills] = useState([]);
  const [expertiseLevel, setExpertiseLevel] = useState('');
  const [isAvailable, setIsAvailable] = useState(false);
  const [showSkillsDropdown, setShowSkillsDropdown] = useState(false);

  const filteredMentors = mentors.filter(mentor => {
    const matchesSearch = mentor.name.toLowerCase().includes(searchQuery.toLowerCase()) ||
      mentor.title.toLowerCase().includes(searchQuery.toLowerCase());
    const matchesSkills = selectedSkills.length === 0 || 
      selectedSkills.some(skill => mentor.skills.includes(skill));
    const matchesAvailability = !isAvailable || mentor.available;

    return matchesSearch && matchesSkills && matchesAvailability;
  });

  return (
    <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
      {/* Filters */}
      <div className="bg-white rounded-lg shadow-sm p-6 mb-8">
        <div className="grid grid-cols-1 md:grid-cols-4 gap-4">
          <div className="col-span-1">
            <input
              type="text"
              placeholder="Search mentors..."
              className="w-full px-4 py-2 border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500"
              value={searchQuery}
              onChange={(e) => setSearchQuery(e.target.value)}
            />
          </div>

          <div className="col-span-1">
            <select
              className="w-full px-4 py-2 border border-gray-300 rounded-md focus:ring-blue-500 focus:border-blue-500"
              value={expertiseLevel}
              onChange={(e) => setExpertiseLevel(e.target.value)}
            >
              <option value="">All Expertise Levels</option>
              <option value="beginner">Beginner</option>
              <option value="intermediate">Intermediate</option>
              <option value="expert">Expert</option>
            </select>
          </div>

          <div className="col-span-1 relative">
            <button
              onClick={() => setShowSkillsDropdown(!showSkillsDropdown)}
              className="w-full p-2 border rounded-md bg-white flex justify-between items-center"
            >
              <span>{selectedSkills.length ? `${selectedSkills.length} skills selected` : 'Select Skills'}</span>
              <svg className="w-4 h-4" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 9l-7 7-7-7" />
              </svg>
            </button>
            {showSkillsDropdown && (
              <div className="absolute z-10 w-full mt-1 bg-white border rounded-md shadow-lg">
                <div className="p-2">
                  {['React', 'Node.js', 'Python', 'JavaScript', 'Machine Learning', 'Data Science', 
                    'DevOps', 'UI/UX', 'Mobile Development'].map((skill) => (
                    <label key={skill} className="flex items-center p-2 hover:bg-gray-100">
                      <input
                        type="checkbox"
                        checked={selectedSkills.includes(skill)}
                        onChange={() => {
                          if (selectedSkills.includes(skill)) {
                            setSelectedSkills(selectedSkills.filter((s) => s !== skill));
                          } else {
                            setSelectedSkills([...selectedSkills, skill]);
                          }
                        }}
                        className="mr-2"
                      />
                      {skill}
                    </label>
                  ))}
                </div>
              </div>
            )}
          </div>

          <div className="col-span-1">
            <label className="flex items-center">
              <input
                type="checkbox"
                checked={isAvailable}
                onChange={(e) => setIsAvailable(e.target.checked)}
                className="rounded border-gray-300 text-blue-600 focus:ring-blue-500 h-4 w-4"
              />
              <span className="ml-2">Available Now</span>
            </label>
          </div>
        </div>
      </div>

      {/* Mentor Grid */}
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        {filteredMentors.map((mentor) => (
          <Link
            key={mentor.id}
            to={`/mentor/${mentor.id}`}
            className="bg-white rounded-lg shadow-sm overflow-hidden hover:shadow-md transition-shadow"
          >
            <div className="p-6">
              <div className="flex items-start space-x-4">
                <img
                  src={mentor.profileImage}
                  alt={mentor.name}
                  className="h-16 w-16 rounded-full object-cover"
                />
                <div>
                  <h3 className="text-lg font-semibold text-gray-900">{mentor.name}</h3>
                  <p className="text-sm text-gray-600">{mentor.title}</p>
                  <div className="flex items-center mt-1">
                    {[...Array(5)].map((_, i) => (
                      <FaStar
                        key={i}
                        className={i < mentor.rating ? 'text-yellow-400' : 'text-gray-300'}
                      />
                    ))}
                    <span className="ml-1 text-sm text-gray-600">({mentor.reviews})</span>
                  </div>
                </div>
              </div>
              <div className="mt-4">
                <div className="flex flex-wrap gap-2">
                  {mentor.skills.map((skill) => (
                    <span
                      key={skill}
                      className="px-2 py-1 text-sm bg-gray-100 text-gray-700 rounded-md"
                    >
                      {skill}
                    </span>
                  ))}
                </div>
              </div>
            </div>
          </Link>
        ))}
      </div>
    </div>
  );
};

export default FindMentor;
